import Link from 'next/link';
import User from './User';
import PleaseSignIn from './PleaseSignIn';
import styled from 'styled-components';




const Adoption = (props) => (
    <User>
        {async ({ data }) => {
            const me = await data ? data.me : null
            console.log(me);

            return (
                <div>
                    <a onClick={() => props.openDrawer()}>Meet the Cats</a>
                    <Link href="/donation">
                        <a>Donation</a>
                    </Link>
                    {me && (
                        <>
                            <Link href="/adoption">
                                <a>Adoption</a>
                            </Link>
                            <Link href="/account">
                                <a>Account</a>
                            </Link>
                        </>
                    )}
                    {!me && (
                        <PleaseSignIn>Sign In</PleaseSignIn>
                    )}
                </div>
            )
        }}
    </User>
);


export default Adoption;
